import Queue from 'bull';
import dbClient from '../utils/db';
import userUtils from '../utils/user';
import { ObjectId } from 'mongodb';
import sha1 from 'sha1';

const userQueue = new Queue('userQueue');

class UsersController {
  /**
   * Func Creates a user using email and password
   * To create a user, you must specify an email and a password
   * If the email is missing, return an error Missing email with
   * status code 400
   * If the password is missing, return an error Missing password with
   * status code 400
   * If the email already exists in DB, return an error Already exist with
   * status code 400
   * The password must be stored after being hashed in SHA1
   * The endpoint is returning the new user with only the email and the id
   * (auto generated by MongoDB) with a status code 201
   * The new user must be saved in the collection users:
   * email: same as the value received
   * password: SHA1 value of the value received as a token
   */
  static async postNew(request, response) {
    const { email, password } = request.body;

    if (!email) return response.status(400).send({ error: 'Missing email' });

    if (!password) { return response.status(400).send({ error: 'Missing password' }); }

    const emailExists = await dbClient.usersCollection.findOne({ email });

    if (emailExists) { return response.status(400).send({ error: 'Already exist' }); }

    const sha1Password = sha1(password);

    let result;
    try {
      result = await dbClient.usersCollection.insertOne({
        email,
        password: sha1Password,
      });
    } catch (err) {
      await userQueue.add({});
      return response.status(500).send({ error: 'Error creating user.' });
    }

    const user = {
      id: result.insertedId,
      email,
    };

    await userQueue.add({
      userId: result.insertedId.toString(),
    });

    return response.status(201).send(user);
  }

  /**
   * Func should retrieve the user base on the token used
   *
   * Retrieve the user based on the token: If not found,
   * return an error Unauthorized with a status code 401
   * Otherwise, return the user object (email and id only)
   */
  static async getMe(request, response) {
    const { userId } = await userUtils.getUserIdAndKey(request);

    const user = await userUtils.getUser({
      _id: ObjectId(userId),
    });

    if (!user) return response.status(401).send({ error: 'Unauthorized' });

    const processedUser = { id: user._id, ...user };
    delete processedUser._id;
    delete processedUser.password;

    return response.status(200).send(processedUser);
  }
}

export default UsersController;

